ASSETS_DIR = "datasets"


def _normalize_english(text: str) -> str:
    return text.strip().lower()


def _normalize_image_path(path: str) -> str:
    normalized = path.strip().replace("\\", "/")
    if normalized.startswith("./"):
        normalized = normalized[2:]
    if normalized.startswith(f"{ASSETS_DIR}/"):
        normalized = normalized[len(ASSETS_DIR) + 1 :]
    if normalized.endswith(".jpg"):
        normalized = normalized[:-4]
    return normalized.lower()


def _build_indexes() -> tuple[dict[str, list[str]], dict[str, list[str]]]:
    if len(ICON_PATHS) != len(TRANSLATED_WORDS):
        raise ValueError(
            "cuneiform_icon_paths and cuneiform_translated_words length mismatch: "
            f"{len(ICON_PATHS)} vs {len(TRANSLATED_WORDS)}"
        )

    english_to_images: dict[str, list[str]] = {}
    image_to_english: dict[str, list[str]] = {}

    for icon, english in zip(ICON_PATHS, TRANSLATED_WORDS):
        image_name = f"{icon}.jpg"
        image_path = f"{ASSETS_DIR}/{image_name}"
        english_key = _normalize_english(english)
        image_key = _normalize_image_path(image_path)

        english_to_images.setdefault(english_key, []).append(image_path)
        image_to_english.setdefault(image_key, []).append(english)

    return english_to_images, image_to_english


_ENGLISH_TO_IMAGES, _IMAGE_TO_ENGLISH = _build_indexes()


def english_to_images(english: str) -> list[str]:
    return list(_ENGLISH_TO_IMAGES.get(_normalize_english(english), []))


def image_to_english(image_path: str) -> list[str]:
    return list(_IMAGE_TO_ENGLISH.get(_normalize_image_path(image_path), []))


cuneiform_icon_paths = ICON_PATHS
cuneiform_translated_words = TRANSLATED_WORDS
